mp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1844144","type":"CustomJS"},{"attributes":{},"id":"1843842","type":"BasicTicker"},{"attributes":{},"id":"1844145","type":"CrosshairTool"},{"attributes":{},"id":"1843835","type":"DataRange1d"},{"attributes":{"children":[[{"id":"1843833"},0,0],[{"id":"1843979"},1,0],[{"id":"1843793"},2,0],[{"id":"1844030"},3,0]]},"id":"1844215","type":"GridBox"},{"attributes":{"line_alpha":{"value":0.2},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"1844090","type":"Segment"},{"attributes":{"active_drag":{"id":"1843849"},"active_scroll":{"id":"1843850"},"tools":[{"id":"1843849"},{"id":"1843850"},{"id":"1843851"},{"id":"1843852"},{"id":"1843853"},{"id":"1843854"},{"id":"1843855"},{"id":"1843878"},{"id":"1844145"}]},"id":"1843857","type":"Toolbar"},{"attributes":{"source":{"id":"1843825"}},"id":"1844098","type":"CDSView"},{"attributes":{"line_alpha":{"value":0
